import React from 'react';
import classes from "./dialogs.module.css";
import {NavLink} from "react-router-dom";
import Message from "../chat/message/message";
const Name =(props)=>
{
    return(
        <div className={classes.userName}>
            <NavLink  activeClassName={classes.active} to={"/dialog/" + props.id} >{props.name}</NavLink>
        </div>
    );
}
const Chat = (props)=>
{
    return(

            <Message text={props.sms}/>

    );
}

const Dialogs = (props) =>
{
    let dialogsData = [
        {id:1, name:'Ivan'},
        {id:2, name:'Dima'},
        {id:3, name:'Gromik'}
        ];
    let messagesData = [
        {id:1, message:'Hello, Ivan!!'},
        {id:2, message:'My name Kirill!!!'},
        {id:3, message:'Idi naxyi'}
    ];
    let dialogsElements = dialogsData.map(dialog=><Name name={dialog.name} id={dialog.id}/>);
    let dialogsMessage = messagesData.map(message=><Chat sms={message.message}/>);
    return(
        <div className={classes.content}>
            <div className={classes.dialogs}>
                {dialogsElements}
            </div>
            <div className={classes.pole}>
                {/*{dialogsMessage}*/}
            </div>
        </div>
    );
}
export default Dialogs;
